import React from 'react'
import ReactDOM from 'react-dom'
import {
  Route,
  NavLink,
  BrowserRouter as Router,
  Switch,
} from 'react-router-dom'
import Tooltip from './tooltip';
import Nav from './nav';
import Kitchen from './kitchen';
import Meals from './meals';
import ProfilePage from './profilepage'

export default class Chef extends React.Component {
    constructor(props) {
        super(props);
    
        this.state = {
            window: 800,
            username: false,
            ingredients: ''
        };
    }
    
    resize() {
        this.setState({
          window: window.innerWidth
        });
    }

    componentDidMount() {
        this.resize();
        window.addEventListener("resize", this.resize.bind(this));
    }
    
    componentWillUnmount() {
        window.removeEventListener("resize", this.resize.bind(this));
    }

    render() {   
        return (
            <Router>
                <div>
                    <div role="banner" className="banner">
                        <img src="https://nolanmcgill.files.wordpress.com/2019/08/chefshat.png" alt="Chef's Hat Logo"></img>
                        <h1>SCRAP CHEF</h1>
                        <Tooltip />
                    </div>
                    <div>
                        <Nav />
                    </div>
                        <Route exact path="/" component={Kitchen} />
                        <Route path="/kitchen" component={Kitchen} />
                        <Route path="/meals" component={Meals} />
                        <Route path="/profilepage" component={ProfilePage} />
                        {/* <Route path="/profile" component={ProfilePage} /> */}
                        {/* <Kitchen /> */}
                        {/* <Meals /> */}
                        {/* <ProfilePage /> */}
                </div>
            </Router>
        );
    }
}
